(self.webpackChunk_taiga_ui_components=self.webpackChunk_taiga_ui_components||[]).push([[66179],{66179:n=>{n.exports='<ng-container *ngIf="currentQuestion < 2; else result">\n    <p>{{ currentQuestion + 1 }}. {{ questionTitles[currentQuestion] }}</p>\n\n    <form [formGroup]="form">\n        <tui-checkbox-labeled\n            *ngFor="let option of questions[currentQuestion]; let index = index; trackBy: trackByIndex"\n            class="tui-space_top-2"\n            [formControlName]="index"\n        >\n            {{ option }}\n        </tui-checkbox-labeled>\n    </form>\n\n    <button\n        size="s"\n        tuiButton\n        type="button"\n        class="tui-space_top-4"\n        (click)="nextQuestion()"\n    >\n        Next\n    </button>\n</ng-container>\n\n<ng-template #result>\n    <p>\n        <b>Your answers</b>\n    </p>\n\n    <div\n        *ngFor="let options of results; let i = index"\n        class="tui-space_top-4"\n    >\n        <p>{{ i + 1 }}. {{ questionTitles[i] }}</p>\n\n        <tui-checkbox-labeled\n            *ngFor="let question of questions[i]; let j = index"\n            class="tui-space_top-2"\n            [ngModel]="options[j]"\n            [readOnly]="true"\n        >\n            {{ question }}\n        </tui-checkbox-labeled>\n    </div>\n</ng-template>\n'}}]);